West Coast is the lead single off Ultraviolence. Ultraviolence is the upcoming third studio album by American singer-songwriter Lana Del Rey. It is scheduled to be released by Polydor and Interscope Records, on June 16, Bloomsday 2014.



[Bloomsday is a commemoration and celebration of the life of Irish writer James Joyce during which the events of his novel Ulysses (which is set on 16 June 1904) are relived. It is observed annually on 16 June in Dublin and elsewhere. Joyce chose the date as it was the date of his first outing with his wife-to-be, Nora Barnacle; they walked to the Dublin suburb of Ringsend. The name is derived from Leopold Bloom, the Ulyssean protagonist. 

The day involves a range of cultural activities including Ulysses readings and dramatisations, pub crawls and other events, much of it hosted by the James Joyce Centre in North Great George's Street. Enthusiasts often dress in Edwardian costume to celebrate Bloomsday, and retrace Bloom's route around Dublin via landmarks such as Davy Byrne's pub. Hard-core devotees have even been known to hold marathon readings of the entire novel, some lasting up to 36 hours. 

- In 1956, Ted Hughes and Sylvia Plath were married by special licence of the Archbishop of Canterbury at St George the Martyr Church, Holborn, on 16 June, in honour of Bloomsday. 

- The post-punk band Minutemen have a song on their 1984 Double Nickels on the Dime album entitled &quot;16 June&quot;.

- Richard Linklater alludes to Ulysses in two of his films. In 1991's Slacker, a character reads an excerpt from Ulysses after convincing his friends to dump a tent and a typewriter in a river as a response to a prior lover's infidelity. In 1995's Before Sunrise, events take place on 16 June.

- Los Angeles: The Hammer Museum hosts an annual Bloomsday celebration including: live Irish music, a Guinness happy hour, a public reading of the &quot;Lestrygonians&quot; episode, and a dramatic reading of &quot;Sirens&quot;.]
